import * as React from 'react';
import AppBar from '@mui/material/AppBar';
import Box from '@mui/material/Box';
import Toolbar from '@mui/material/Toolbar';
import Typography from '@mui/material/Typography';
import Button from '@mui/material/Button';
import { Link } from 'react-router-dom';
import { makeStyles } from '@material-ui/core';

const useStyles = makeStyles((theme) => ({
    btndark: {
        color:'white',
        textDecoration:'none',
        backgroundColor:'dark'
    },
}));

export default function Navbar() {
    const classes = useStyles();
    return (
        <>
            <Box sx={{ flexGrow: 1 }}>
                <AppBar position="static" color="secondary">
                    <Toolbar>
                        <Typography
                            variant="h6"
                            component="div"
                            sx={{ flexGrow: 1 }}
                        >
                            News
                        </Typography>
                        <Link to="/Business" className={classes.btndark}>
                            <Button color="inherit">business</Button>
                        </Link>
                        <Link
                            to="/Entertainment"
                            className="text-white bg-dark mx-3 text-decoration-none"
                        >
                            <Button color="inherit">entertainment</Button>
                        </Link>
                        <Link to="/General" className="text-white bg-secondary text-decoration-none">
                            <Button color="inherit">general</Button>
                        </Link>
                        <Link to="/Health" className="text-white bg-dark mx-3 text-decoration-none">
                            <Button color="inherit">health</Button>
                        </Link>
                        <Link to="/Science" className="text-white bg-success text-decoration-none">
                            <Button color="inherit">science</Button>
                        </Link>
                        <Link to="/Sports" className="text-white bg-dark mx-3 text-decoration-none">
                            <Button color="inherit">sports</Button>
                        </Link>
                        <Link to="/Technology" className="text-white bg-danger text-decoration-none ">
                            <Button color="inherit">technology</Button>
                        </Link>
                    </Toolbar>
                </AppBar>
            </Box>
        </>
    );
}
